import { BtnEffect } from "./BtnEffect";
import { Link } from "react-router-dom";

export const StartBtn = () => {
  return (
    <Link to="/signup">
      <BtnEffect>
        <h4>Start!</h4>
      </BtnEffect>
    </Link>
  );
};

export const AccountBtn = () => {
  return (
    <Link to="/">
      <BtnEffect>
        <h4 style={{ fontSize: "1.2rem" }}> 회원가입/로그인 </h4>
      </BtnEffect>
    </Link>
  );
};
